import axios from 'axios';
import {fromJS} from 'immutable';

const addFeedList = (list) => ({
  type: 'add_feed_list',
  list: fromJS(list)
})

export const getMoreList = () => {
  return (dispatch) => {
    axios.get('/api/feedMore.json').then((res) =>{
      const result = res.data.data;
      dispatch(addFeedList(result));
      console.log(result);
    })
  }
}
